import React, {Component, Fragment} from 'react';

class SearchPage extends Component {
    constructor({match}) {
        super();
        this.state={
            SearchKey:match.params.SearchKey,
            ProductData:[],
            isLoading:"TopSection",
            MainDiv:"d-none"

        }
    }
    render() {
        return (
            <Fragment>
                 <h1>{this.state.SearchKey}</h1>
            </Fragment>
        );
    }
}

export default SearchPage;
